The model renders complex objects in three-dimensional space.
 The image is a set of small noisy dots the combination of which creates bizarre shapes.

Made with p5.js and WEBGL.

There are three traits:
- 5 “Palette”;
- 3 “Function”;
- 6 “Draw styler”;

Press 's' to save .png with resolution 2000px * 2000px 

Works fastest in chrome browser.

@ivposure
August 2022

